import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material';

const NavBar = () =>  {
    return (
            <React.Fragment>
                 <AppBar>

                    <Toolbar >
                        <Typography> Depp coding </Typography>
                        <Typography> User List </Typography>
                        <Typography> Add User </Typography>
                    </Toolbar>  
             </AppBar>
            </React.Fragment>
        
            
        
        
    );
}

export default NavBar;
